import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const Monitoring = () => {
  const [monitoring, setMonitoring] = useState([]);
  const [performance, setPerformance] = useState(null);
  const token = localStorage.getItem('token');
  const headers = { Authorization: `Bearer ${token}` };

  useEffect(() => {
    // Fetch monitoring logs
    axios.get('/api/monitoring', { headers })
      .then(res => setMonitoring(res.data))
      .catch(err => alert('Failed to fetch monitoring logs'));

    // Fetch student performance data
    axios.get('/api/student/performance', { headers })
      .then(res => setPerformance(res.data))
      .catch(err => alert('Failed to fetch performance data'));
  }, []);

  return (
    <div className="container mt-5">
      {/* Existing monitoring logs */}
      <h3>Monitoring Logs</h3>
      <table className="table">
        <thead>
          <tr>
            <th>Action</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {monitoring.map(log => (
            <tr key={log.id}>
              <td>{log.action}</td>
              <td>{log.timestamp}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* New Student Performance Section */}
      <h3 className="mt-5">Student Performance</h3>
      {performance ? (
        <table className="table table-bordered">
          <thead>
            <tr>
              <th>Assessment</th>
              <th>Score / Status</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Test 1</td>
              <td>{performance.test1}</td>
            </tr>
            <tr>
              <td>Midterm</td>
              <td>{performance.midterm}</td>
            </tr>
            <tr>
              <td>Assignment</td>
              <td>{performance.assignment}</td>
            </tr>
            <tr>
              <td>Final Exam</td>
              <td>{performance.finalExam}</td>
            </tr>
            <tr>
              <td>Attendance</td>
              <td>{performance.attendance}%</td>
            </tr>
            <tr>
              <td>Results</td>
              <td>{performance.results}</td>
            </tr>
            <tr>
              <td>Upcoming Tests</td>
              <td>{performance.upcomingTests.join(', ')}</td>
            </tr>
            <tr>
              <td>Timetable</td>
              <td>{performance.timetable}</td>
            </tr>
          </tbody>
        </table>
      ) : (
        <p>Loading performance data...</p>
      )}
    </div>
  );
};

export default Monitoring;
